import style from '../static/Style';
import Layout from '../components/Layout';


export default () => {
  <Layout header="Next" title="To page.">
    <p>Welcome to next.js</p>
    <hr/>
    <Link href="./other"><button>
      go to other &gt;&gt;
    </button></Link>
  </Layout>
}
